import React from "react";
import KanjiData from "./kanjidata";

const Kanji = () => {
    const KData = KanjiData.kanji_data;
    console.log(KData);
    return (
        <div>
            {KData.map((item) => {
                <p>item.jlpt</p>
            })}
        </div>
    )
}

export default Kanji;
